import './App.css';
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";
import MainPageRoutes from "./routes/MainPageRoutes";

function App() {
    return (
        <div className="App">
            <Header/>
            <main>
                <MainPageRoutes/>
            </main>
            <Footer/>
        </div>
    );
}

export default App;
